import{_ as e,o as a,c as l,Q as o}from"./chunks/framework.ab7e7ee0.js";const g=JSON.parse('{"title":"复盘总结 | 2023.07.24-2023.12.31","description":"","frontmatter":{"title":"复盘总结 | 2023.07.24-2023.12.31","author":"许小墨","date":"2024-02-12","categories":["碎碎念个人成长"],"tags":["复盘总结"],"sidebar":"auto"},"headers":[{"level":1,"title":"2023 年年度复盘总结","slug":"_2023-年年度复盘总结","link":"#_2023-年年度复盘总结","children":[]},{"level":1,"title":"🖼️ 序言","slug":"🖼️-序言","link":"#🖼️-序言","children":[]},{"level":1,"title":"📈 学习时间统计","slug":"📈-学习时间统计","link":"#📈-学习时间统计","children":[]},{"level":1,"title":"📝blog 输出","slug":"📝blog-输出","link":"#📝blog-输出","children":[{"level":2,"title":"新技术","slug":"新技术","link":"#新技术","children":[]},{"level":2,"title":"Linux","slug":"linux","link":"#linux","children":[]},{"level":2,"title":"一些零碎知识点","slug":"一些零碎知识点","link":"#一些零碎知识点","children":[]}]},{"level":1,"title":"⏰ 总结","slug":"⏰-总结","link":"#⏰-总结","children":[]}],"relativePath":"column/Growing/ReviewSummary/001.md","filePath":"column/Growing/ReviewSummary/001.md","lastUpdated":1707839101000}'),t={name:"column/Growing/ReviewSummary/001.md"},i=o('<h1 id="_2023-年年度复盘总结" tabindex="-1">2023 年年度复盘总结 <a class="header-anchor" href="#_2023-年年度复盘总结" aria-label="Permalink to &quot;2023 年年度复盘总结&quot;">​</a></h1><h1 id="🖼️-序言" tabindex="-1">🖼️ 序言 <a class="header-anchor" href="#🖼️-序言" aria-label="Permalink to &quot;🖼️ 序言&quot;">​</a></h1><p>搁置了很久的 2023 年复盘在今天才进行了归纳整理。</p><p>在去年中，有 <code>1/3</code> 的时间在给自己充电，有 <code>2/3</code> 的时间在给公司当牛马。</p><h1 id="📈-学习时间统计" tabindex="-1">📈 学习时间统计 <a class="header-anchor" href="#📈-学习时间统计" aria-label="Permalink to &quot;📈 学习时间统计&quot;">​</a></h1><p>累计统计天数： <code>5</code> 月 <code>8</code> 天</p><p>累计学习时间： <code>76</code> h <code>15</code> min</p><p>月均学习时间： <code>15</code> h <code>12</code> min</p><h1 id="📝blog-输出" tabindex="-1">📝blog 输出 <a class="header-anchor" href="#📝blog-输出" aria-label="Permalink to &quot;📝blog 输出&quot;">​</a></h1><h2 id="新技术" tabindex="-1">新技术 <a class="header-anchor" href="#新技术" aria-label="Permalink to &quot;新技术&quot;">​</a></h2><p>完成 <code>Java</code> 的入门学习，累计花费时间 <code>65h15min</code> 。</p><p>在学习完 <code>Java</code> 的入门内容之后，对自己的新期待是，学习服务端框架，比如 <code>nest.js</code> 。</p><h2 id="linux" tabindex="-1">Linux <a class="header-anchor" href="#linux" aria-label="Permalink to &quot;Linux&quot;">​</a></h2><p>继<code>Java</code>过后，重新把之前学过的Linux基础命令进行归纳总结，进一步复习。</p><p>对于Linux命令来说，总结下来就是不要死记硬背，每天多使用几次，Linux的常用命令自然烂熟于心。这也算是相对比较大的一个难关，没有其他捷径可走，<strong>多使用</strong>，<strong>多练习</strong>，<strong>多总结</strong>，<strong>多归纳</strong>，方为上策。</p><h2 id="一些零碎知识点" tabindex="-1">一些零碎知识点 <a class="header-anchor" href="#一些零碎知识点" aria-label="Permalink to &quot;一些零碎知识点&quot;">​</a></h2><p>之前学习基础知识的时候，对一些知识点的认识只停留在表面，没有很深入的去了解。于是在这5个月也赶忙一起整理了，把之前的困惑都尽快地清除。</p><h1 id="⏰-总结" tabindex="-1">⏰ 总结 <a class="header-anchor" href="#⏰-总结" aria-label="Permalink to &quot;⏰ 总结&quot;">​</a></h1><p>可以说在这 5 个月中，对自己的学习时间放的太宽，间接地摸鱼时间似乎又多了许多。做复盘的同时也想要给自己敲一个警钟，时间对于每个人来说都是平等的，希望能够正视到自己所存在的问题，尽快地调整好作息规范~</p>',19),n=[i];function r(d,c,s,h,u,p){return a(),l("div",null,n)}const m=e(t,[["render",r]]);export{g as __pageData,m as default};
